document.addEventListener("DOMContentLoaded",function(el){let bump_element_data_title="bump-element";let custom_bump_content_data_title="custom-bump-content";let bump=document.querySelector('[data-title="'+bump_element_data_title+'"] .sectioncontent');let bump_content=bump.getElementsByTagName("div")[1];bump_content.style.display="none";let custom_bump=document.querySelector('[data-title="'+custom_bump_content_data_title+'"]');bump.appendChild(custom_bump);bump.querySelector(".container").style.padding="0";bump.querySelector(".containerInner").style.padding="0";bump.querySelectorAll(".containerInner .innerContent").forEach(e=>{e.style.padding="0"})});